import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('CHULALONGKORNBold-normal.ttf', font);
this.addFont('CHULALONGKORNBold-normal.ttf', 'CHULALONGKORNBold', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])

export const family = 'CHULALONGKORN';
export const src = font;